import './App.css';
import 'antd/dist/antd.css'
import { Col, Row } from 'antd'
import Details from './components/Details/Details';
import Main from './components/Main/Main'
import styled from "@emotion/styled";

const Wrapper = styled.div`
  width:100%;
  height:100%;
  margin-top:50%;
`
const Box = styled.div`
  margin: auto 16px;
`

function App() {
  return (
    <Wrapper>
      <Box>
        <Row gutter={16}>
          <Col span={8}>
            <Details title={'收入'} />
          </Col>
          <Col span={8}>
            <Main title={'記帳本'} />
          </Col>
          <Col span={8}>
            <Details title={'支出'} />
          </Col>
        </Row>
      </Box>
    </Wrapper>
  );
}

export default App;
